import React from 'react';
import Header from './components/Header';
import { useNavigate } from 'react-router-dom'

const App = () => {

  let navigate = useNavigate(); 
  const handleClick = () => {
    let path = './stats'; 
    navigate(path); 
  }

  return (
    <div className="flex flex-col items-center justify-center h-screen">
      <Header />
      <button
        onClick={handleClick}
        className="bg-custom-blue text-white font-wotfard text-xl py-2 px-4 rounded mt-4"
      >
        Get Started
      </button>
    </div>
  );
};

export default App;
